    this.state = {
      users: []
    }
  }

  componentDidMount() {

  const url = [
    "https://jsonplaceholder.typicode.com/users",
  ];
  fetch(url)
  .then(response => response.json())
  .then((response) => {
    this.setState({
      users: response
    })
    console.log(this.state.users)
  });

  }

